import React from 'react';
import { useNavigate } from 'react-router-dom';
import './HomePage.css';

function HomePage() {
    const navigate = useNavigate();

    const handleNavigate = (userType) => {
        navigate(`/signin/${userType}`);
    };

    return (
        <div className="home-page">
            <h1>Welcome to Booktown</h1>
            <h2>The place where every book has a story, and every story finds its reader</h2>
            <div className="button-container">
                <button onClick={() => handleNavigate('seller')}>Seller</button>
                <button onClick={() => handleNavigate('buyer')}>Buyer</button>
            </div>
        </div>
    );
}

export default HomePage;
